description:
nhà mặt ngõ - gần phố - trung tâm cầu giấy – dòng tiền cho thuê ổn định 30tr/th_ 6tầng – 40m2 – 9,2 tỷ
+ mô tả:
- vị trí vip trung tâm phường cầu giấy, ngõ cực thoáng, ba gác đỗ cửa, 20m ra phố yên hòa, ba bước tới chợ, tiện ích xung quanh không thiếu gì;
- giao thông thuận tiện, gần trường tiểu học, thcs và thpt yên hòa;
- xung quanh là nhiều trường đại học lớn như đh thủ đô, đh quốc gia, sư phạm 1, đh gtvt, hv báo chí, hv ngoại giao, đh ngoại thương,...nhu cầu thuê rất cao;
+ nhà thiết kế 6 tầng, khung btct (mặt tiền: 3,4m)
- tầng 1: phòng khách + bếp + wc;
- tầng 2,3,4,5: mỗi tầng 2 phòng ngủ + wc khép kín;
- tầng 6: phòng thờ  + sân phơi;
tổng 8 phòng, chủ cho thuê dòng tiền 30tr/tháng, chủ mới về có thể tiếp quản luôn.
giá: 9,2 tỷ
 sổ đỏ vuông vắn chính chủ, cất két sẵn sàng giao dịch.
